import useSWR from "swr/dist/index";
import { Spinner } from "react-bootstrap";
import React from 'react';

function DashboardHook({dataUrl, stateCallback}){
  const { data, error } = useSWR(dataUrl);
  if (error) return <h1>Something went wrong!</h1>;
  if (!data) return <Spinner animation="border" variant="primary" size="mg"/>;
  return stateCallback(data)
}

export default DashboardHook;
